import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  handleLinkedIn = () => {

  }

  render() {
    return (
    <div  style={{backgroundColor: "black", width: "100%", height: "100%"}}>
    	<div className = "Name">
        Brendan  Michael Muldowney
    	</div>
      <div className = "Major">
        Major: Computer Engineering
      </div>
      <div className = "GPA">
        GPA: 3.75
      </div>
      <div className = "LinkedIn" onClick = {() =>window.open("google.com", "_blank")}>
        LinkedIn
      </div>
    </div>
    );
  }
}

export default App;
